import './card.styles.css';

const Card = ({ film }) => {
  const { Title, year, poster } = film;

  return (
    <div className='card-container'>
      <img
        alt={`monster ${Title}`}
        src={`https://robohash.org/${1}?set=set2&size=180x180`}
      />
      <h2>{Title}</h2>
      <p>{year}</p>
    </div>
  );
};

export default Card;
